import { Link } from 'react-router-dom';

const Footer: React.StatelessComponent = () => {
  return (
    <footer>
        <ul className="footerLinks">
            <li>
                <Link to="/about"></Link>
            </li>
        </ul>


    </footer>
  );
};

export default Footer;
